import React from 'react';
import './RegisBtn.css';
import { useNavigate } from 'react-router-dom';
import { TweenMax, Expo } from 'gsap';

// Register Btn view
export default function RegisBtn() {

 return (
  <BtnRegisterUser />
 );
};

export const BtnRegisterUser = () => {

 const navigation = useNavigate();
 const handleNavigation = (event) => {
  event.preventDefault();
  navigation('/register/region');
 };

 React.useEffect(() => {
  TweenMax.from('.btn-transition', 1, { delay: .7, y: 30, opacity: 0, ease: Expo.easeIn })

 }, []);


 return (
  <div className='wrp-Btn-Register'>
   <button className='Btn' onClick={handleNavigation}>Register</button>
  </div>
 );
};
